import React from 'react';
import styled from 'rn-css';
import { colors, Text } from '@mevron/cross-core/components/typo';
import { TextInput } from '@mevron/cross-core/components/Forms';

const Container = styled.View`
    background-color: #fff;
    border-radius: 10px;
    padding: 15px;
`;

const GenerateButton = styled.TouchableOpacity`
    height: 40px;
    width: 200px;
    background-color: ${colors.defaultColor};
    margin-top: 10px;
    border-radius: 5px;
    justify-content: center;
    align-items: center;
`;

const GenerateButtonText = styled(Text)`
    color: #fff;
`;

export default function Name() {
    return (
        <Container>
            <TextInput title="Search by first name or last name" />
            <GenerateButton>
                <GenerateButtonText>Search</GenerateButtonText>
            </GenerateButton>
        </Container>
    );
}
